"_blank">纪小纪</a>&nbsp;<a href="/s/-%E5%B0%8F%E9%BB%91%E9%BE%99------------/" target="_blank">小黑龙</a>&nbsp;<a href="/s/-%E5%A4%A7%E8%A1%A8%E5%93%A5------------/" target="_blank">大表哥</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%E6%A0%BE%E6%97%AD--------/" target="_blank">栾旭</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/13/" target="_blank">国产剧</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E5%A4%A7%E9%99%86-----------/" target="_blank">大陆</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2017/" target="_blank">2017</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.07.13</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>一幢公寓内，生活着这样一群人每当夜幕降临，大多数人卸下一天的疲惫，开始享受老婆孩子热炕头的时候，TA们的工作才刚刚开始。TA们是一群站在流行最前沿的人，面对镜头，TA们总是那么光鲜靓丽，青春帅气！但镜头之外……TA们跟我们一样，也有自己的生活，也有自己的理想，也有对未来的憧憬和向往。在这样一个充满青</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/41463/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/10190/" data-original="http://cj.subo8988.com:8988/upload/vod/2018-10-13/201810131539402375.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">4.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">HD</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/10190/">非常主播</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%E8%BD%A6%E5%A4%AA%E8%B4%A4------------/" target="_blank">车太贤</a>&nbsp;<a href="/s/-%E6%9C%B4%E5%AE%9D%E8%8B%B1------------/" target="_blank">朴宝英</a>&nbsp;<a href="/s/-%E7%8E%8B%E6%99%B3%E9%93%89------------/" target="_blank">王晳铉</a>&nbsp;<a href="/s/-%E5%AE%8B%E6%B2%B3%E6%B3%A2------------/" target="_blank">宋河波</a>&nbsp;<a href="/s/-%E9%BB%84%E9%9B%A8%E7%91%9F%E6%83%A0------------/" target="_blank">黄雨瑟惠</a>&nbsp;<a href="/s/-------------/" target="_blank"></a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%E5%A7%9C%E7%82%AF%E5%93%B2--------/" target="_blank">姜炯哲</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/7/" target="_blank">喜剧片</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E9%9F%A9%E5%9B%BD-----------/" target="_blank">韩国</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2009/" target="_blank">2009</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.07.13</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>生活优渥的单身贵族南贤洙（车太贤 饰）曾是一名失败的歌手，年过而立后，他迎来了事业的第二春。贤洙所主持的谈话类节目备受欢迎，尤其是近段时间单身妈妈静南寻找生身父亲的故事更掀起收听率飙升的高潮。某晚，贤洙正等待和女友共度浪漫一夜的时候，一对不速之客破坏了这一切。来者正是静南（朴宝英 饰）和她6岁的儿子</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/10190/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-lis